import React from 'react';
import styled from 'styled-components';
import logo from '../icons/logo.svg';
import { Link } from "react-router-dom";

const LeftNav = styled.div`
    display: flex;
    position: relative;

    img {
        position: absolute;
        top: -1.5rem;
        left: -1.5rem;
        height: 8rem;
    }   

    ul {
    margin-left: 8rem;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    list-style: none;
    }

    li button {
        margin: 0 1rem;
        padding: .3rem 1rem;
        color: ${(props) => props.theme.colors.primary};
        border-radius : 2rem;
        border: none;
        text-align: center;
        text-transform: uppercase;
        background-color: #fff;
        box-shadow: -2px -2px 8px rgba(255,255,255,1);



    }

`;

const HeaderNav = () => {


    return (
        <LeftNav>
            <img src={logo} alt="Logo" />
            <ul>
                <li><Link to="/home"><button value="Home">Home</button></Link></li>
                <li><Link to="/menu"><button value="Menu">Menu</button></Link></li>
                <li><Link to="/cart"><button value="Cart">Cart</button></Link></li>
            </ul>
        </LeftNav >
    )
}

export default HeaderNav;
